import React from "react";
import Card from "./Card"
import Details from "./Details_page";
import Ifelse from "./Ifelse"
import Netflix from "./Netflix"



const choice ="netflix";

function Choice (){
if(choice === "netflix"){
    return (
        <>
        <Netflix/>
        </>
    );
}
else {
    return (
    <>
    <Amazon/>
    </>
    )
}
}

function Webseries_card(value,index,arr){
    return (
        <Card
            key = {value.id}
            card_img = {value.card_img}
            title = {value.title}
            links = {value.links}
            headname = {value.headname}
        />
    )
}

function App(){
    return (    
        <>  
        <h1 className="main_heading">List Of Top 50 Webseries</h1>
        
        {Details.map(Webseries_card)}
        </>
    );
}

export default App;
